import React, { useEffect } from "react";

const HolidayData = () => {
  useEffect(() => {
    // GET request using fetch inside useEffect React hook
    fetch(
      "https://calendarific.com/api/v2/holidays?&api_key=c7297e49e430234f8e0cd0ca2e79b304d476153a&country=US&year=2019"
    )
      .then((response) => {
        response.json();
        console.log(" before JSON response", response.json());
      })
      .then((data) => console.log(data));

    // empty dependency array means this effect will only run once (like componentDidMount in classes)
  }, []);
  return <div>HolidayData</div>;
};

export default HolidayData;
